import React from 'react';
import { Link } from 'react-router-dom';
// import 'bootstrap/dist/css/bootstrap.min.css';
import "./style.css"
import "./animate.css"


const Navbar = () => {
  return (
    <div className="container-xxl position-relative p-0">
      <nav className="navbar navbar-expand-lg navbar-light px-4 px-lg-5 py-3 py-lg-0" >
        <Link to="/" className="navbar-brand p-0">
          <h1 className="m-0">BizConsult</h1>
          {/* <img src="img/logo.png" alt="Logo"> */}
        </Link>
        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarCollapse">
          {/* <span className="fa fa-bars"></span> */}
        </button>
        <div className="collapse navbar-collapse" id="navbarCollapse">
          <div className="navbar-nav ms-auto py-0">
            <Link to="/" className="nav-item nav-link">Home</Link>
            <Link to="/aboutus" className="nav-item nav-link">About</Link>
            <Link to="/services" className="nav-item nav-link active">Service</Link>
            <div className="nav-item dropdown">
              <Link to="#" className="nav-link dropdown-toggle" data-bs-toggle="dropdown">Pages</Link>
              <div className="dropdown-menu m-0">
                <Link to="/features" className="dropdown-item">Features</Link>
                <Link to="/team" className="dropdown-item">Our Team</Link>
                <Link to="/testimonial" className="dropdown-item">Testimonial</Link>
              </div>
            </div>
            <Link to="/contactus" className="nav-item nav-link">Contact</Link>
          </div>
        </div>
      </nav>
    </div>
  );
};

export default Navbar;
